import React from 'react';
import { portfolioData } from '../data/portfolioData';

const Skills = () => {
  const { technical, soft } = portfolioData.skills;

  return (
    <section id="skills" className="py-20 bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-16">
          <h2 className="text-4xl font-bold text-gray-900 mb-4">Skills & Expertise</h2>
          <div className="w-24 h-1 bg-primary mx-auto mb-4"></div>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Here are the technical and soft skills I've acquired throughout my journey
          </p>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
          {/* Technical Skills */}
          <div>
            <h3 className="text-2xl font-semibold text-gray-900 mb-8 text-center lg:text-left">
              Technical Skills
            </h3>
            <div className="space-y-4">
              {technical.map((skill, index) => (
                <div 
                  key={skill.name} 
                  className="fade-in-up bg-white rounded-lg p-4 shadow-md hover:shadow-lg transition-all duration-300"
                  style={{ animationDelay: `${index * 0.1}s` }}
                >
                  <div className="flex justify-between items-center mb-3">
                    <div className="flex items-center space-x-3">
                      <span className="text-2xl">{skill.icon}</span>
                      <span className="font-semibold text-gray-800">{skill.name}</span>
                    </div>
                    <span className="text-sm font-medium text-primary bg-primary/10 px-2 py-1 rounded">
                      {skill.level}%
                    </span>
                  </div>
                  <div className="w-full bg-gray-200 rounded-full h-2">
                    <div
                      className="bg-gradient-to-r from-primary to-accent h-2 rounded-full transition-all duration-1000 ease-out"
                      style={{ width: `${skill.level}%` }}
                    ></div>
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Soft Skills */}
          <div>
            <h3 className="text-2xl font-semibold text-gray-900 mb-8 text-center lg:text-left">
              Soft Skills
            </h3>
            <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
              {soft.map((skill, index) => (
                <div
                  key={skill}
                  className={`fade-in-up bg-white p-4 rounded-lg shadow-md border-l-4 hover:shadow-lg transition-all duration-300 transform hover:scale-105 ${
                    skill.includes("Communication") 
                      ? "border-green-500 bg-green-50" 
                      : "border-primary"
                  }`}
                  style={{ animationDelay: `${index * 0.1 + 0.5}s` }}
                >
                  <div className="flex items-center space-x-3">
                    <div className={`w-8 h-8 rounded-full flex items-center justify-center ${
                      skill.includes("Communication") 
                        ? "bg-green-100 text-green-600" 
                        : "bg-primary/10 text-primary"
                    }`}>
                      <span className="text-sm">
                        {skill.includes("Communication") ? "ðŸ’¬" : "âœ“"}
                      </span>
                    </div>
                    <span className={`font-medium ${
                      skill.includes("Communication") 
                        ? "text-green-800" 
                        : "text-gray-700"
                    }`}>
                      {skill}
                    </span>
                  </div>
                </div>
              ))}
            </div>

            {/* Communication Skills Highlight */}
            <div className="mt-8 bg-gradient-to-r from-green-500 to-green-600 rounded-lg p-6 text-white">
              <div className="flex items-center space-x-3 mb-3">
                <span className="text-2xl">ðŸ’¬</span>
                <h4 className="text-xl font-semibold">Excellent Communication</h4>
              </div>
              <p className="text-white/90 leading-relaxed">
                Strong verbal and written communication skills with ability to explain complex technical 
                concepts clearly to both technical and non-technical audiences. Experienced in client 
                interactions and team collaborations.
              </p>
            </div>

            {/* Technologies Summary */}
            <div className="mt-6 bg-white rounded-lg p-6 shadow-md">
              <h4 className="text-lg font-semibold text-gray-900 mb-4">Tech Stack</h4>
              <div className="flex flex-wrap gap-2">
                {["MERN Stack", "JavaScript", "Python", "Java", "HTML/CSS", "Tailwind", "Bootstrap", "C Language"].map((tech) => (
                  <span key={tech} className="bg-primary/10 text-primary px-3 py-1 rounded-full text-sm font-medium">
                    {tech}
                  </span>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
